import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import ExerciseLog from './components/ExerciseLog';
import Goals from './components/Goals';
import Progress from './components/Progress';
import Header from './components/Header';
import './styles/styles.css';

function App() {
  return (
    <Router>
      <div>
        <Header />
        <Routes>
          <Route path="/login" element={<Login />} /> {/* Change here */}
          <Route path="/register" element={<Register />} /> {/* Change here */}
          <Route path="/log-exercise" element={<ExerciseLog />} /> {/* Change here */}
          <Route path="/goals" element={<Goals />} /> {/* Change here */}
          <Route path="/progress" element={<Progress />} /> {/* Change here */}
          {/* You can also define a default route here if desired */}
          <Route path="/" element={<Home />} /> {/* Assuming you have a Home component */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
